webpackJsonp([136329116176353e5],{"./node_modules/json-loader/index.js!./.cache/json/css-text-align.json":function(t,e){t.exports={data:{markdownRemark:{html:"<h2>Text Align</h2>\n<p>This css property describes how inline content like text is aligned in its parent block element. <code>text-align</code> does not control the alignment of block elements, it affects only their inline content.</p>\n<h3>Values:</h3>\n<p>The <code>text-align</code> property is specified as a single keyword chosen from the list of values below.  </p>\n<p>text-align: left;<br>\ntext-align: right;<br>\ntext-align: center;<br>\ntext-align: justify;<br>\ntext-align: justify-all;<br>\ntext-align: start;<br>\ntext-align: end;<br>\ntext-align: match-parent;</p>\n<h4>More Information:</h4>\n<ul>\n<li><a href='https://www.w3.org/TR/REC-CSS1/#text-align' target='_blank' rel='nofollow'>CSS1 Spec</a></li>\n<li><a href='https://www.w3.org/TR/CSS21/text.html#alignment-prop' target='_blank' rel='nofollow'>CSS2 Spec</a></li>\n<li><a href='https://www.w3.org/TR/css-text-3/#justification' target='_blank' rel='nofollow'>CSS3 Spec</a></li>\n<li><a href='https://developer.mozilla.org/en-US/docs/Web/CSS/text-align' target='_blank' rel='nofollow'>MDN Web Docs</a></li>\n<li><a href='https://css-tricks.com/almanac/properties/t/text-align/' target='_blank' rel='nofollow'>CSS Tricks</a></li>\n</ul>",fields:{slug:"/css/text-align/"},frontmatter:{title:"Text Align"}}},pathContext:{slug:"/css/text-align/"}}}});
